import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import {makeStyles} from '@material-ui/core/styles';
import React from 'react';
import {StyleSheet, Text} from 'react-native';


const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },

}));

const styles = {
  titleStyle:{

  },
  descriptionStyle:{

  },
  ContentStyles:{

  },
  paper: {
    padding: 10,
    textAlign: 'center',
    color: '#000',
  }
}

type cardprops={
  title?: string
  description?:string
  children?: React.ReactNode
  data?:any
  titleStyles?:any
  subtitleStyles?:any
  cardData?:any
  ContentHeaderStyles?:any
  ContentTitleStyles?:any
  ContentDescriptionStyles?:any
}

export const CardDisplayV = (props:cardprops) => {
  const _getCards = () => {
    // let _data = Array.isArray(props?.cardData) && props?.cardData.map(item=>{
    //   return(
    //     <Grid item xs={12} sm={6} md={3}>
    //       <Paper style={StyleSheet.flatten(styles.paper)}>
    //          <h1 style={props.ContentHeaderStyles}>{item?.header}</h1>
    //          <h3 style={props.ContentTitleStyles}>{item?.title}</h3>
    //          <p>{item?.description}</p>
    //        </Paper>
    //     </Grid>
    //   )
    // });
    // return _data;

    const _tempData:any = [];
  // eslint-disable-next-line no-unused-expressions
    Array.isArray(props?.cardData) && props?.cardData.forEach(item=>{
      _tempData.push(
        <Grid item xs={12} sm={6} md={3}>
          <Paper style={StyleSheet.flatten(styles.paper)}>
            {
              item?.icon ? <img style={StyleSheet.flatten([styles.ContentStyles, props?.ContentHeaderStyles])} src={item.icon}/> : null
            }
             <Text style={StyleSheet.flatten([styles.ContentStyles, props?.ContentHeaderStyles])}>{item?.header}</Text>
             <Text style={StyleSheet.flatten([styles.ContentStyles, props?.ContentTitleStyles])}>{item?.title}</Text>
             <Text style={StyleSheet.flatten([styles.ContentStyles, props?.ContentDescriptionStyles])}>{item?.description}</Text>
           </Paper>
        </Grid>
      )
    });
    return _tempData;
  }

  return(
    <Grid container justify={"center"} alignItems={"center"} >
      <Grid item xs={12}>
        <Text style={StyleSheet.flatten([styles.titleStyle, props?.titleStyles])}>{props?.title}</Text>
        <Text style={StyleSheet.flatten([styles.descriptionStyle, props?.subtitleStyles])}>{props?.description}</Text>
      </Grid>
      <Grid item xs={11}>
      <Grid container justify={"center"} alignItems={"center"} spacing={4}>
      {_getCards()}
      </Grid>
      </Grid>

    </Grid>
  )
}
